} Line 16's code, Serial.begin(9600);, sets the Serial speed at 9600 bits per second (bps) Line 17's code, pinMode(en, OUTPUT);, sets pin 10 on the Arduino Uno as an output so that a signal can be sent to the Enable 1 & 2 pin of the L293D chip. Line 18's and 19's code, pinMode(in1, OUTPUT); pinMode(in2, OUTPUT), sets pin 9 and 8 on the Arduino Uno as an output so that a signal can be sent to the Input 1 & 2 pin of the L293D chip respectively. #define en 10
