{ tempValue = analogRead(temp); temperature = ((tempValue*(5.0/1024.0))-0.5)/0.01; if( temperature <= 30.0 && movedRight == false) { motorInstructions(); debugger(); digitalWrite(in1, LOW); digitalWrite(in2, HIGH); delay(1000); digitalWrite(in2, LOW); movedRight = true; movedLeft = false; } else if ( temperature >= 40.0 && movedLeft == false) { motorInstructions(); debugger(); digitalWrite(in1, HIGH); digitalWrite(in2, LOW); delay(1000); digitalWrite(in1, LOW); movedLeft = true; movedRight = false; }
} Starting with line 24, the code tempValue = analogRead(temp); will read the TMP36 wired to pin A0 of the Arduino, and convert voltage to the Analogue Digital Converted value. Remember the that voltage rang is 0V to 5V and the ADC of the Arduino is 10-bits, so its range is 0 - 1023. Line 25's code, temperature = ((tempValue*(5.0/1024.0))-0.5)/0.01;}, converts the the temp value, (0 - 358) to Celsius with a range of \(-40^{\circ}C\) to \(125^{\circ}C\), see equation 6 . \[ \begin{aligned} temperature = \cfrac{\left(\left(tempValue \cdot \left( \cfrac{5.0V}{1024}\right)\right)-0.5\right)}{0.01}\\ \Rightarrow 26.17^{\circ}C = \cfrac{\left(\left(156 \cdot \left( \cfrac{5.0V}{1024}\right)\right)-0.5\right)}{0.01} \end{aligned}\tag{Eqn:6} \] TODO: Add inline comments on lines 24 - 25 for what each variable is for, using the // comment symbols Now that the temperature value has been calculated, lines 27 and 39 can be explained. Line 27's code, if( temperature <= 30.0 && movedRight == false), checks to see if the temperature is less than or equal to, <=, 30.0. If this condition is true then the second part of the conditional statement can be checked, using &&. the boolean (true or false) variable movedRight == false is compared for equality ==, remember a single = means assign the right hand side to the left hand side. Now if both conditions are true then the code between lines 29 and 37 will be executed. If either statement is false, then then line 39 is executed. Line 39's code is much the same as line 27's, but the temperature has to be greater or equal to, >=, 40.0 and movedLeft must be false. If both statements are true then lines 41 to 49 are executed, if not then the programme loops back to the line 24, and the process starts again. Now we can look inside lines 29 to 30 & lines 40 to 49, you probably can see that there are only a few differences between the two blocks of code. We will look at lines 29, 30, 41 and 42 later. Lets look at lines 32, 33 and 44 and 45, where the two sets of lines are polar opposites of each other. The digitalWrite(in1, LOW); digitalWrite(in1, HIGH); & digitalWrite(in2, LOW); digitalWrite(in2, HIGH); changes the direction the motor spins. Looking at the block diagram of the L293D, we can see that Input 1, and Input 2, both pin 3 and 7 on the L293D change the direction of the motor. Lines 34 and 46 code, delay(1000),allowing the motor to turn in that direction for 1 second. TODO: Add inline comments on lines 33 - 35 & 44 - 47 for what each variable is for, using the // comment symbols Lines 36, 37 & 48, 49 both set the movedLeft and movedRight variables true or false. Now it is time to return to lines 29 & 41, both sets of lines do the same things so look below at the code for motorInstructions();, add to end of the script after the closing } of the void loop(). void motorInstructions()
{ rads = 53.0 * (2*3.1415926/60.0); degrees = rads * 57.2958; analogWrite(en, pwmOutput);
} Let's first look at line 55's code, rads = 53.0 * (2*3.1415926/60.0);, calculates the radians per second using equation 3 . Where \(\pi\) is shown to 7 decimal places. The 53.0 the average speed the DC motor in response to the resistors value of \(1k\Omega\). Line 56's code, degrees = rads * 57.2958;, which is taken from equation 4 , to calculate the degrees per second. Line 57's code, analogWrite(en, pwmOutput);, outputs the PWM signal,pwmOutput value of 12 to the en pin, to the Enable 1 & 2 pin of the L293D. The value of en, 12, again is preset because of the resistors value of \(1k\Omega\). So lastly, lets look at the function debugger(); called on lines 30 and 42 of the void loop() function. void debugger()
{ Serial.print("Temperature: "); Serial.print(temperature); Serial.print(" | RAD/s: "); Serial.print(rads); Serial.print(" | Degree/s: "); Serial.println(degrees);
} So we can see that lines 62 to 67 output information about the variables to the serial montior. Now you have a better understanding of the circuit and the code ... TODO: What happens to the motor when the resistance value is changed? Adjust line 55's rpm value to match the motors rpm value. With the knowledge that each line of code takes some time to execute, specifically mathematical functions. Would pre calculating all of the constants in an equation speed up the programme? Try it. Explore the code, make changes to experiment with different temperature values, timings, conditional statements (if, else if). Full code is seen below: #define en 10
#define in1 9
#define in2 8
#define temp A0 int pwmOutput = 12;
float tempValue;
float temperature;
float rads = 0.0;
float degrees = 0.0;
bool movedRight = false;
bool movedLeft = false; void setup()
{ Serial.begin(9600); pinMode(en, OUTPUT); pinMode(in1, OUTPUT); pinMode(in2, OUTPUT);
} void loop()
{ tempValue = analogRead(temp); temperature = ((tempValue*(5.0/1024.0))-0.5)/0.01; if( temperature <= 30.0 && movedRight == false) { motorInstructions(); debugger(); digitalWrite(in1, LOW); digitalWrite(in2, HIGH); delay(1000); digitalWrite(in2, LOW); movedRight = true; movedLeft = false; } else if ( temperature >= 40.0 && movedLeft == false) { motorInstructions(); debugger(); digitalWrite(in1, HIGH); digitalWrite(in2, LOW); delay(1000); digitalWrite(in1, LOW); movedLeft = true; movedRight = false; }
} void motorInstructions()
{ rads = 53.0 * (2*3.1415926/60.0); degrees = rads * 57.2958; analogWrite(en, pwmOutput);
} void debugger()
{ Serial.print("Temperature: "); Serial.print(temperature); Serial.print(" | RAD/s: "); Serial.print(rads); Serial.print(" | Degree/s: "); Serial.println(degrees);
}

